import React from 'react';
import './style.scss';
import logo from '../images/logo.svg';
import star from '../images/star.svg';
import monica from '../images/monica.jpeg';
import ridhi from '../images/ridhi.jpg';
import arun from '../images/arun.jpg';
import pankaj from '../images/pankaj.jpeg';
import uday from '../images/uday.jpg';
import ram from '../images/ram.jpeg';

function Home() {
    return (
        <div className="container">
            <div class="row">
                <div class="col m-1">
                    <figure class="effect-bubba">
                        <img src={monica}/>
                        <figcaption>
                            <h2>Fresh <span>Bubba</span></h2>
                            <p>Bubba likes to appear out of thin air.</p>
                            <a href="#">View more</a>
                        </figcaption>
                    </figure>
                </div>
                <div class="col m-1">
                    <img src={monica} className="img-thumbnail img-fluid rounded" alt="logo" />
                </div>
                <div class="col m-1">
                    <img src={ridhi} className="img-thumbnail img-fluid rounded" alt="logo" />
                </div>
                <div class="col m-1">
                    <img src={arun} className="img-thumbnail img-fluid rounded" alt="logo" />
                </div>
            </div>
            <div class="row">
                <div class="col m-1">
                    <img src={uday} className="img-thumbnail img-fluid rounded" alt="logo" />
                </div>
                <div class="col m-1">
                    <img src={pankaj} className="img-thumbnail img-fluid rounded" alt="logo" />
                </div>
                <div class="col m-1">
                    <img src={ram} className="img-thumbnail img-fluid rounded" alt="logo" />
                </div>
            </div>
        </div>
    );
}

export default Home;
